import React from 'react'
import * as B from '../Styles/ButtonComponente.js'
interface ButtonComponenteProps {
  titulo: string;
  onClick: () => void | Promise<void>; // Aceita tanto funções síncronas quanto assíncronas
}

const ButtonComponente = (porps: { titulo: string, onClick: () => void }) => {
  return (
    <B.Button onClick={porps.onClick}>
        {porps.titulo}
    </B.Button>
  )
}

export default ButtonComponente
